import React from "react";
import PropTypes from 'prop-types';

class FormCidade extends React.Component{
  render() {
    const { handler, cidade } = this.props;
    return(
      <fieldset>
        <label>
          Cidade:
          <br></br>
          <input
            type="text"
            name='cidade'
            value={cidade}
            onChange={handler}
            onBlur={(event) => event.target.value.startsWith(/[0-9]/g) ? event.target.value = '' : 0}
            maxLength="28">
          </input>
        </label>
      </fieldset>
    )
  }
}

FormCidade.propTypes = {
  handler: PropTypes.func.isRequired,
  cidade: PropTypes.string.isRequired,
};

export default FormCidade;
